DROP TABLE IF EXISTS plan_asistente;
DROP TABLE IF EXISTS detalle_preferencia;
DROP TABLE IF EXISTS plan;
DROP TABLE IF EXISTS preferencia;
DROP TABLE IF EXISTS usuario;
DROP TABLE IF EXISTS usuario_preferencia;


-- tables


-- Table: plan
CREATE TABLE plan (
    id_plan serial  NOT NULL,
	nombre varchar(30) NOT NULL,
    descripcion varchar(100)  NOT NULL,
    ubicacion varchar(100)  NOT NULL,
    fecha_inicio timestamp  NOT NULL,
    fecha_final timestamp  NOT NULL,
    costo_promedio int  NOT NULL,
    creador_plan int  NOT NULL,
    detalle_preferencia int  NOT NULL,
	imagen_plan blob,
    CONSTRAINT plan_pk PRIMARY KEY (id_plan)
);

-- Table: plan_asistente
CREATE TABLE plan_asistente (
    plan_id int  NOT NULL,
    usuario_id int  NOT NULL,
    CONSTRAINT plan_asistente_pk PRIMARY KEY (plan_Id,usuario_id)
);

-- Table: preferencia
CREATE TABLE preferencia (
    id_preferencia serial  NOT NULL,
    nombre varchar(50)  NOT NULL,
    CONSTRAINT nombre UNIQUE (nombre) ,
    CONSTRAINT preferencia_pk PRIMARY KEY (id_preferencia)
);

-- Table: usuario
CREATE TABLE usuario (
    id_usuario serial  NOT NULL,
    email varchar(100)  NOT NULL,
    contrasena varchar(16)  NOT NULL,
    nombres varchar(100)  NOT NULL,
    apellidos varchar(100)  NOT NULL,
    usuario varchar(100)  NOT NULL,
    tipo_id varchar(100)  NOT NULL,
	numero_id varchar(100)  NOT NULL,
    foto_perfil blob,
    CONSTRAINT usuario_pk PRIMARY KEY (id_usuario)
);

-- Table: usuario_preferencia
CREATE TABLE usuario_preferencia (
    usuario int  NOT NULL,
    detalle_preferencia int  NOT NULL,
    CONSTRAINT usuario_preferencia_pk PRIMARY KEY (usuario)
);

